import React from "react";
import { Link } from "react-router-dom";

const HomePage = () => {
  return (
    <nav>
      <Link to="/home">Home</Link>
      <Link to="/contact">Contact</Link>
      <Outlet />
    </nav>
  );
};

export default HomePage;
